package com.xzh.bean;

public class Configuration {
	private int ct_id;
	private String ct_type;
	private String ct_value;
	
	public Configuration() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getCt_id() {
		return ct_id;
	}
	public void setCt_id(int ct_id) {
		this.ct_id = ct_id;
	}
	public String getCt_type() {
		return ct_type;
	}
	public void setCt_type(String ct_type) {
		this.ct_type = ct_type;
	}
	public String getCt_value() {
		return ct_value;
	}
	public void setCt_value(String ct_value) {
		this.ct_value = ct_value;
	}
}
